func maximumScore(nums []int, k int) int {
 const mod = 1000000007
 primeScores := make([]int, len(nums))
 for i, num := range nums {
  primeScores[i] = getPrimeScore(num)
 }

 type element struct {
  value, primeScore int
 }
 elements := make([]element, len(nums))
 for i := range elements {
  elements[i] = element{nums[i], primeScores[i]}
 }

 sort.Slice(elements, func(i, j int) bool {
  if elements[i].primeScore == elements[j].primeScore {
   return elements[i].value > elements[j].value
  }
  return elements[i].primeScore > elements[j].primeScore
 })

 score := 1
 for i := 0; i < k; i++ {
  score = (score * elements[i].value) % mod
 }

 return score
}

func getPrimeScore(n int) int {
 score := 0
 for i := 2; i*i <= n; i++ {
  if n%i == 0 {
   score++
   for n%i == 0 {
    n /= i
   }
  }
 }
 if n > 1 {
  score++
 }
 return score
}
